import React from 'react'
import MaterialTable, { MTableEditField } from 'material-table';
import { Button, Dialog, DialogActions, DialogContent, DialogTitle, MenuItem, Menu } from '@material-ui/core';
import CreateIcon from '@mui/icons-material/Create';
import DeleteIcon from '@mui/icons-material/Delete';
import { Autocomplete, IconButton } from '@mui/material';
import Select from '@mui/material/Select';
import ListItemText from '@mui/material/ListItemText';
import Checkbox from '@mui/material/Checkbox';
import AddCircleRoundedIcon from '@mui/icons-material/AddCircleRounded';
import data from '../../../../Data/paddockData.json';

const names = [
  'Defective Grain, ',
  'Foreign Material, ',
  'Heat Damage, ',
  'Impurities, ',
  'Moisture, ',
  'Oil, ',
  'Protein, ',
  'Purity, ',
  'Screenings, ',
  'Test Weight, ',
  'Total Damage, ',
  'Unmillable Material, ',
  'Vitreous Kernels, ',
  'Grade, ',
  'Retention, ',
  'Scale Reading, ',
  'Falling Numbers, '
];
const ITEM_HEIGHT = 48;
const ITEM_PADDING_TOP = 8;
const MenuProps = {
  PaperProps: {
    style: {
      maxHeight: ITEM_HEIGHT * 4.5 + ITEM_PADDING_TOP,
      width: 250,
    },
  },
};

export default function CultivarsTable() {
  const [personName, setPersonName] = React.useState([]);
  const [grain, setgrain] = React.useState([]);
  const handleChange = (event, index) => {
    const {
      target: { value },
    } = event;
    setPersonName(
      // On autofill we get a the stringified value.
      typeof value === 'string' ? value.split(',') : value,
    );
  };

  const [anchorEl, setAnchorEl] = React.useState(null);
  const open = Boolean(anchorEl);
  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };
  const handleClose = () => {
    setAnchorEl(null);
  }

  const handleMenuItemClick = (event, index, rowData) => {
    setAnchorEl(null);
    rowData.weight = grains[index].kilo + "kg/hl"
    console.log(rowData.tableData.id)

  };

  const grains = [
    { id: 1, title: "Barley(62 kg/hl)", kilo: 62 },
    { id: 2, title: "Canary Seed(70 kg/hl)", kilo: 70 },
    { id: 3, title: "Canola(70 kg/hl)", kilo: 70 },
    { id: 4, title: "Cereal Rye(71 kg/hl)", kilo: 71 },
    { id: 5, title: "Chickpea(75 kg/hl)", kilo: 75 },
    { id: 6, title: "Cowpea(75 kg/hl)", kilo: 75 },
    { id: 7, title: "Faba Bean(75 kg/hl)", kilo: 75 },
    { id: 8, title: "Field Pea(75 kg/hl)", kilo: 75 },
    { id: 9, title: "Grain Sorghum(72 kg/hl)", kilo: 72 },
    { id: 10, title: "Linseed(72 kg/hl)", kilo: 72 },
    { id: 11, title: "Lupin(75 kg/hl)", kilo: 75 },
    { id: 12, title: "Maize(72 kg/hl)", kilo: 72 },
    { id: 13, title: "Millet(62 kg/hl)", kilo: 62 },
    { id: 14, title: "Mungbean(75 kg/hl)", kilo: 75 },
    { id: 15, title: "Navy Bean(75 kg/hl)", kilo: 75 },
    { id: 16, title: "Oats(45 kg/hl)", kilo: 45 },
    { id: 17, title: "Pigeon Pea(75 kg/hl)", kilo: 75 },
    { id: 18, title: "Rice(56 kg/hl)", kilo: 56 },
    { id: 19, title: "Safflower(53 kg/hl)", kilo: 53 },
    { id: 20, title: "Soybean(75 kg/hl)", kilo: 75 },
    { id: 21, title: "Sunflower(40 kg/hl)", kilo: 40 },
    { id: 22, title: "Triticale(65 kg/hl)", kilo: 65 },
    { id: 23, title: "Vetch(75 kg/hl)", kilo: 75 },
    { id: 24, title: "Wheat(75 kg/hl)", kilo: 75 }
  ];
  
  const columns = [{
    title: 'Name', field: 'name',
  },
  {
    title: 'Grain Weight', field: 'weight'
  },
  {
    title: "Preset Grain Weights",
    field: "internal_action",
    sorting: false,
    editable: false,
  
    title: 'Varieties', field: 'Varieties', sorting: false,
  },
  {
    title: 'Traits', field: 'Traits', sorting: false,
    editComponent: props => (
      console.log(props.rowData.Traits[0]),
      <Select
        type="text"
        variant="standard"
        multiple
        value={props.value}
        onChange={e =>props.onChange(e.target.value)}
      >
    {
    names.map((name) => (
      <MenuItem key={name} value={name}>
        <Checkbox checked={props.value.indexOf(name) > -1} />
        <ListItemText primary={name} />
      </MenuItem>
    ))
  }
  </Select>
  )
  // render: (rowData) =>
  // rowData && (
  //   <div>
  //     <Select
  //         labelId="demo-multiple-checkbox-label"
  //         id="demo-multiple-checkbox"
  //         multiple
  //         variant="standard"
  //         value={personName}
  //         onChange={(e)=>(handleChange(e,rowData.tableData.index))}
  //         // input={<OutlinedInput label="Tag" />}
  //         renderValue={(selected) => selected.join(', ')}
  //         MenuProps={MenuProps}
  //       >
  //         {names.map((name) => (
  //           <MenuItem key={name} value={name}>
  //             <Checkbox checked={personName.indexOf(name) > -1} />
  //             <ListItemText primary={name} />
  //           </MenuItem>
  //         ))}
  //       </Select>
  //   </div>
  //     )
}]
return (
  <div>
    <MaterialTable title="Cultivars"
      data={data}
      columns={columns}
      editable={{
        onRowAdd: newData =>
          new Promise((resolve, reject) => {
            setTimeout(() => {
              setData([...data, newData]);

              resolve();
            }, 1000)
          }),
        onRowUpdate: (newData, oldData) =>
          new Promise((resolve, reject) => {
            setTimeout(() => {
              const dataUpdate = [...data];
              const index = oldData.tableData.id;
              dataUpdate[index] = newData;
              setData([...dataUpdate]);

              resolve();
            }, 1000)
          }),
        onRowDelete: oldData =>
          new Promise((resolve, reject) => {
            setTimeout(() => {
              const dataDelete = [...data];
              const index = oldData.tableData.id;
              dataDelete.splice(index, 1);
              setData([...dataDelete]);

              resolve()
            }, 1000)
          }),
      }}
      options={{
        actionsColumnIndex: -1
      }}
      icons={{Add:()=><AddCircleRoundedIcon fontSize="large" color="primary"/>,
      Edit: () => <CreateIcon color="action" />,
      Delete: () => <DeleteIcon color="action" />}}
    />
  </div>
)
}
